use std::collections::{HashSet};
use std::iter::FromIterator;

struct Solution;

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        let mut length: usize = 0;
        
        if s.len() <= 1 {
            return s.len() as i32;
        }
        
        for i in 0..s.len() {
            let mut curr_str = String::new();
            let mut main_map: HashSet<char> = HashSet::new();
            let ith_char = s.chars().nth(i).unwrap();

            curr_str.push(ith_char);
            main_map.insert(ith_char);
            
            for x in i+1..s.len() {
                let xth_char = s.chars().nth(x).unwrap();
                
                if !main_map.contains(&xth_char) {
                    curr_str.push(xth_char);
                    main_map.insert(xth_char);
                } else {break; };

                if length < curr_str.len() {
                    length = curr_str.len();
                }

            }

            if length < curr_str.len() {
                length = curr_str.len();
            }

        }


        length as i32
    }
}

